    "/v1.1/workflows/start": {
      "post": {
        "description": "Allowed Role(s): admin\nAllowed User(s): Who have RUN permission to given workflow",
        "tags": [
          "Workflows"
        ],
        "summary": "Handler to start workflow execution.",
        "operationId": "startWorkflowRequestV1Dot1",
        "parameters": [
          {
            "type": "string",
            "x-go-name": "WorkflowID",
            "description": "ID of the Workflow, to start workflow using id. (Not allow to provide both of ID and UniqueName of Workflow)",
            "name": "workflow_id",
            "in": "query"
          },
          {
            "type": "string",
            "x-go-name": "UniqueName",
            "description": "Unique Name of the Workflow, to start workflow using unique_name of it\n(Not allow to provide both of ID and UniqueName of Workflow)",
            "name": "unique_name",
            "in": "query"
          },
          {
            "type": "boolean",
            "x-go-name": "Sync",
            "description": "if true, starts workflow with sync.\nIf workflow execution takes more than 28 second, API returns the current status of the instance\nand workflow continue to run in the background\nAPI returns 200 Ok on successful completion of instance\nAPI return 201 Accepted if the workflow still in running state after 28 second",
            "name": "sync",
            "in": "query"
          },
          {
            "type": "boolean",
            "x-go-name": "Async",
            "description": "if true, workflow execution is processed asynchronously",
            "name": "async",
            "in": "query"
          },
          {
            "type": "file",
            "x-go-name": "File",
            "description": "Upload File\nSwagger UI supports only one file to upload\nIn case of multiple input file variables use separate rest client",
            "name": "file_name",
            "in": "formData"
          },
          {
            "type": "string",
            "x-go-name": "RequestBody",
            "description": "The workflow to submit.\nPlease refer /v1/workflows/start API for request_body payload",
            "name": "request_body",
            "in": "formData"
          }
        ],
